(1, 'Announcement', 'Portfolio BTC/USD will be available on 28th November 2019 onwards. Please kindly to be remind minimum investment set buy $10USD as per market analyzed.', '2019-11-28 04:13:15'),
(2, 'Dear SuperCryptoFinance client', 'Portfolio BCH/USDT will be available on 8th December 2019.\r\n\r\nThank You.', '2019-12-07 15:40:51'),
(3, 'Update', 'From 17th December onwards, dev had provided 3 product consist of Mini, Basic & Mega Portfolios. Happy New Year ! ! !', '2019-12-16 21:44:11'),
(4, 'Announcement :', 'Dear valued client Supercryptofinance.com,\r\nSCF Token bonus will be online at January 1st 2020 followed by BTC portfolio on January 2nd 2020.<BR><BR>\r\nStay tuned !\r\n<BR><BR>\r\nThank You.', '2019-12-31 16:05:59'),
(5, 'Announcement :', 'GOOD NEWS ! ! !\r\nDear Supercryptofinance.com client, we are proudly to present  out latest BTC PORTFOLIO offered active within 7th January 2020 as per news lately. Happy New Year ! ! !', '2020-01-06 21:56:16'),
(6, 'Good Day!', 'Dear Supercryptofinance.com client,due to prolonged intervals of Basic Portfolio, we will convert the current Basic Portfolio into Super Portfolio and we will merge Mini Portfolio with Prime Portfolio in order to keep the rising rotation of Crypto Trading with introduce variation of portfolios. Hopefully we can continue fulfill the desire of monetization for each of us.\r\n\r\nThank You.', '2020-01-17 03:40:26');
